import { toggleSelectedState } from './actions'


const initialState = {
    products: {
        1: {
            name: 'яблоко',
            selected: true
        },
        2: {
            name: 'орехи',
            selected: false
        },
        3: {
            name: 'печенье',
            selected: false
        },
    }
}

export const productsReducer = (state = initialState, action) => {
    switch (action.type) {
        default: {
            return state
        }
    }
}
